// Copied from fromZigbee.js
// The standard converter does not append the endpoint number

fz.ptvo_humidity = {
  cluster: 'msRelativeHumidity',
  type: ['attributeReport', 'readResponse'],
  options: [exposes.options.precision('humidity'), exposes.options.calibration('humidity')],
  convert: (model, msg, publish, options, meta) => {
    const humidity = parseFloat(msg.data['measuredValue']) / 100.0;

    // https://github.com/Koenkk/zigbee2mqtt/issues/798
    // Sometimes the sensor publishes non-realistic vales, it should only publish message
    // in the 0 - 100 range, don't produce messages beyond these values.
    if (humidity >= 0 && humidity <= 100) {
      const property = zigbeeHerdsmanUtils.postfixWithEndpointName('humidity', msg, model, meta);
      return {[property]: zigbeeHerdsmanUtils.calibrateAndPrecisionRoundOptions(humidity, options, 'humidity')};
    }
  },
};

fz.ptvo_pressure = {
  cluster: 'msPressureMeasurement',
  type: ['attributeReport', 'readResponse'],
  options: [exposes.options.precision('pressure'), exposes.options.calibration('pressure')],
  convert: (model, msg, publish, options, meta) => {
    let pressure = 0;
    if (msg.data.hasOwnProperty('scaledValue')) {
      const scale = msg.endpoint.getClusterAttributeValue('msPressureMeasurement', 'scale');
      pressure = msg.data['scaledValue'] / Math.pow(10, scale) / 100.0; // convert to hPa
    } else {
      pressure = parseFloat(msg.data['measuredValue']);
    }
    const property = zigbeeHerdsmanUtils.postfixWithEndpointName('pressure', msg, model, meta);
    return {[property]: zigbeeHerdsmanUtils.calibrateAndPrecisionRoundOptions(pressure, options, 'pressure')};
  },
};

fz.ptvo_illuminance = {
  cluster: 'msIlluminanceMeasurement',
  type: ['attributeReport', 'readResponse'],
  options: [exposes.options.calibration('illuminance', 'percentual'), exposes.options.calibration('illuminance_lux', 'percentual')],
  convert: (model, msg, publish, options, meta) => {
    // multi-endpoint version based on the stastard onverter 'fz.illuminance'
    // DEPRECATED: only return lux here (change illuminance_lux -> illuminance)
    const illuminance = msg.data['measuredValue'];
    const illuminanceLux = illuminance === 0 ? 0 : Math.pow(10, (illuminance - 1) / 10000);
    const multiEndpoint = model.meta && model.meta.hasOwnProperty('multiEndpoint') && model.meta.multiEndpoint;
    const property1 = (multiEndpoint)? zigbeeHerdsmanUtils.postfixWithEndpointName('illuminance', msg, model, meta): 'illuminance';
    const property2 = (multiEndpoint)? zigbeeHerdsmanUtils.postfixWithEndpointName('illuminance_lux', msg, model, meta): 'illuminance_lux';
    return {
      //-- MIKE => just fixed output format: "XXX" => "(XXX / 100).toFixed(2)"
      [property1]: (zigbeeHerdsmanUtils.calibrateAndPrecisionRoundOptions(illuminance, options, 'illuminance') / 100).toFixed(2),
      [property2]: zigbeeHerdsmanUtils.calibrateAndPrecisionRoundOptions(illuminanceLux, options, 'illuminance_lux'),
    };
  },
};

const custom_illuminance = {
  cluster: 'msIlluminanceMeasurement',
  type: ['attributeReport', 'readResponse'],
  convert: (model, msg, publish, options, meta) => {
    // DEPRECATED: only return lux here (change illuminance_lux -> illuminance)
    const illuminance = msg.data['measuredValue'];
    const illuminanceLux = (illuminance === 0) ? 0 : (illuminance / 1.2).toFixed(2);
    return {illuminance: illuminance, illuminance_lux: illuminanceLux};
    //return {illuminance: illuminanceLux};
  },
}


//-- up to 8 endpoints (1-3: DS18B20, 4-5: empty, 6: BMX280/BH1750, 7-8: empty)
//-- the last endpoint number
const lastEPNumС3 = 6;
//-- list of exposes
const expItemsС3 = [];
//-- endpoints substitution "l1: 1"
const epItemsС3 = {};

//-- EndPoints from 1 to lastEPNumС3
for(let i = 1; i <= lastEPNumС3; i++) {
	if(i == 4 || i == 5) {
		//-- skipping...
	} else if(i == 6) {
		//-- DS18B20
		expItemsС3.push(e.temperature().withEndpoint('l6').withUnit('°C').withDescription('BMX280 temperature sensor #6'));
		expItemsС3.push(e.pressure().withEndpoint('l6').withUnit('hPa').withDescription('BMX280 pressure sensor #6'));
		expItemsС3.push(e.humidity().withEndpoint('l6').withUnit('%').withDescription('BMX280 humidity sensor #6'));
		expItemsС3.push(e.illuminance().withEndpoint('l6').withUnit('lux').withDescription('BH1750 #6'));
	} else {
		expItemsС3.push(e.temperature().withEndpoint('l'+i).withUnit('°C').withDescription('DS18B20 temperature sensor #'+i));
	}
}
//-- list of EP substitutions
for(let i = 1; i <= lastEPNumС3; i++) {
	epItemsС3['l'+i] = i;
}
//-- list of fromZigbee itmes 
